import React from 'react'

const RegisterContainer = () => {
    return (
        <div>
            {['name', 'lastname', 'username', 'email', 'password', 'repeat password'].map((item, index => {
                return <input type='text' name={item} placeholder={item} key={index} className='inputForm'></input>
            }))}
        </div>
    )
}

export default RegisterContainer
